import React from "react";

const Navbar3 = () => {
    return(
        <>
        <div class="px-4 pt-5 container-mw-lg container-fluid ">
            <h2 class="display-1 heading pb-5 pb-md-4 new-on-edx_header d-flex ">
                <span class="emphasized ">New</span>
                  on edX
            </h2>
        </div>
        </>
    )
}

export default Navbar3;
